import React from 'react'
import {Link} from "react-router-dom"

const Header = () => {

    const style = { display: "inline-block" , margin: 10 , marginBottom: 30 ,textDecoration: "none" ,color: "white",  backgroundColor: "teal", 
    padding: "10px 20px", 
    borderRadius: 5, 
    boxShadow: "0 2px 5px rgba(0, 0, 0, 0.2)", 
    transition: "background-color 0.3s, color 0.3s" };
    return(
        <div>
            <div>
                <h2 style={style}>
                    <Link to="/" style={style}>Home</Link>
                </h2>
                <h2  style={style}>
                    <Link to="/Quotes" style={style} >Quotes</Link>
                </h2>

            </div>
        </div>
    )
}

export default Header;
